INSERT INTO `posts` VALUES ('Nhượng cọc chung cư','Mình cần bán cọc căn hộ tại dự án Paragon, Duy Tân, Càu Giấy. Mình đã vào cọc 300tr/ căn. Hạn đóng 30%: 10/5/2024. Đơn giá 52-53tr/m2 (giá cđt đang bán ~60tr). Toà đã có thông báo làm sổ. Cần bán ngang cọc do có việc. Mình chịu chi phí sang cọc.','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-09-01 00:00:00',3,2,0,140,300000000,'Trần Quốc Vượng, Phường Dịch Vọng Hậu, Quận Cầu Giấy, Hà Nội','Hợp đồng mua bán','','','Chung cư',1,0,3,'DMCH0',1,21.0283,105.854),('Chủ đầu tư bán chung cư 360 xã đàn - Trung Phụng 35-52m2 ,vào ở luôn','Chính chủ Bán chung cư T1  Phố Xã Đàn -Trung Phụng -  Quận Đống Đa 35 - 60m2-   Full nội thất ,vào ở luôn ,sổ đỏ riêng  làn ô tô chạy quay đầu \n\nVị Trí vàng hà nội\nCăn hộ xây dựng mới hiện đại, đã hoàn thiện có thể xách đồ về ở ngay. \n\nGần các trường đại học - chợ - siêu thị - trường học các cấp - đi lại thuận lợi. \n\nGiá trả :  693tr - 735 triệu - 928tr - hơn 1 tỷ. \n\nDiện tích: 35m2- 48m2- 52m2- 56m2 - 58m \n\nTòa nhà thiết kế tầng 1 để xe, tầng trên cùng là tầng tum sân phơi chung còn lại là các tầng căn hộ, có đầy đủ hệ thống phòng cháy chữa cháy tự động, an ninh tòa nhà bảo vệ chuyên nghiệp. \n\nSổ hồng sở hữu vĩnh viễn - nhận nhà ở ngay. \n\nChủ đầu tư: \nLiên hệ trực tiếp chủ đầu tư để mua nhà - add Zalo để nhận video căn hộ','ACCEPTED','2024-05-10 02:28:02','2024-04-28 22:28:03','2024-09-01 00:00:00',2,1,0,50,790000000,'Xã Đàn, Phường Trung Phụng, Quận Đống Đa, Hà Nội','Hợp đồng mua bán','','Nội thất đầy đủ','Chung cư',1,5,3,'DMCH0',2,21.0283,105.854),('Chính chủ cần bán căn hộ WestGate Bình Chánh diện tich 59m','Căn Hộ ngay Tầng 6 trực diện view hồ bơi rất đẹp .< Ưu tiên giá tốt cho chính chủ mua >','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-09-29 00:00:00',2,2,0,59,2700000000,'Đường Tân Túc, Thị trấn Tân Túc, Huyện Bình Chánh, Tp Hồ Chí Minh','Hợp đồng mua bán','Đông','Hoàn thiện cơ bản','Chung cư',1,0,3,'DMCH0',3,10.6951,106.591),('Căn hộ ngay cầu Rồng sông Hàn, vốn sở hữu chỉ từ 600 triệu, hỗ trợ 70%','Chính thức mở bán toà tháp đôi Sun Ponte Resdence Đà Nẵng, sở hữu lâu dài trực diện sông Hàn giai đoạn 1 giá gốc trực tiếp chủ đầu tư.\nNhận đặt chỗ ưu tiên 1 vị trí căn đẹp, hoàn tiền 100%, nhận ngay chiết khấu 1% - 3%.\nLiên hệ ngay Giám đốc dự án từ CĐT Sun Group *** để nhận được hỗ trợ và chính sách ưu đãi ***.\n--------------------------\n- Chủ đầu tư: Tập đoàn SunGroup.\n- Vị trí: Ngay cầu Rồng mặt tiền đường Trần Hưng Đạo, P. An Hải Tây, Q. Sơn Trà, TP. Đà Nẵng \nQuy mô:\n- Cao tầng: Tổng 528 căn gồm 495 căn hộ cao cấp (Studio, 1PN, 1PN + 1, 2PN, 3PN,... ), 7 căn Penthouse và 26 căn Shophouse khối đế.\n+ Căn Studio diện tích 28 - 40m vốn ban đầu chỉ từ 700 triệu.\n+ Căn hộ 1 phòng ngủ diện tích 52m² vốn ban đầu chỉ từ 900 triệu.\n+ Căn 1 phòng ngủ + 1 diện tích 48 - 69m² vốn ban đầu chỉ từ 1,6 tỷ.\n+ Căn 2 phòng ngủ diện tích 70 - 80m² vốn ban đầu chỉ từ 2 tỷ.\n+ Căn 3 phòng ngủ diện tích 90 - 100m².\n+ Căn dual key diện tích 100 - 110m².\n+ Căn Penthouse.\nSở hữu lâu dài, căn hộ thiết kế cao 3,5-7m, full kín kịch trần, cửa 2 lớp cách âm cách nhiệt, chống tia UV và nhìn trộm.\nPhương thức thanh toán linh động\nThanh toán 24 tháng chiết khấu 7%\nThanh toán 95% trong tháng 4 chiết khấu 19%\nThanh toán 30%, hỗ trợ vay 70%, 0% lãi suất ngân hàng 30 tháng.\nChính sách chiết khấu dự kiến từ 5 - 15%, phương thức thanh toán linh động.\nTặng gói trải nghiệm Sun Group 0,5 - 2%.','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-06-29 00:00:00',2,1,0,35,1800000000,'Cầu Rồng, Đường Trần Hưng Đạo, Phường An Hải Tây, Quận Sơn Trà, Đà Nẵng','Đang chờ sổ','','Bàn giao thô','Chung cư',1,0,2,'DMCH0',4,16.0612,108.228),('Giảm Giá ,bán chung cư Phố Cự Lộc -Cạnh Roay City -Thanh xuân ,Sổ hồng','Giảm Giá Sâu ...Bán chung cư mini giá rẻ hà nội Tại Phố Cự Lộc - Nguyễn Trái - quận Thanh Xuân nhà mới, ô tô đỗ cửa, sổ hổng lâu dài.\n.\nLiên hệ Thái chủ đầu tư để mua nhà.\nSDT :( có Zalo - Miễn môi giới )\n\nChung cư xây dựng mới hiện đại, đã hoàn thiện có thể xách đồ về ở ngay.\nCạnh Trung tâm thương mại Roay City\nGần các trường đại học - chợ - siêu thị - trường học các cấp - đi lại thuận lợi.\n\nGiá bán: 600tr - 700tr - 800tr - 900tr - hơn 1 tỷ\n\nDiện tích: 45m² - 48m - 52m - 54m - 60m - 66m².\n\nTòa nhà thiết kế tầng 1 để xe, có đầy đủ hệ thống phòng cháy chữa cháy tự động, an ninh tòa nhà bảo vệ chuyên nghiệp.\nNội thất full đồ : Giường Tủ , Bếp Trên dưới ,Bình nóng Lạnh ,Máy giặt ,Điều Hòa ,Tủ Lanh, Sofa...\nSổ hồng sở hữu vĩnh viễn - nhận nhà ở ngay.\n\nThanh toán nhanh chiết khấu cao hơn.\n\nLiên hệ trực tiếp Thái chủ đầu tư để mua nhà giá gốc.\nSDT :\nLưu ý em không hỗ trợ vay ngân hàng, miễn trung gian.','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-12-16 00:00:00',2,1,0,52,890000000,'Phố Cự Lộc, Phường Nhân Chính, Quận Thanh Xuân, Hà Nội','Sổ hồng riêng','','Nội thất đầy đủ','Chung cư',1,0,3,'DMCH0',5,21.0283,105.854),('căn hộ','Chính chủ view hồ bơi nội khu đối diện Wincom Mega Mall \n - Tiện ích,hồ bơi, gần sân yoga, vườn cọ, phòng sông hơi jacuzi karaoke quảng trường Golden Eagle và trường học quốc tế Anh Quốc \n - VINHOME còn có xe điện lưu thông quanh nội khu miễn phí , \n - VINHOME grand park còn có xe buýt đi đến trung tâm tp quân1 cũng như liên thông tới các VINCOM trên toàn thành phố rất tiện \n - Một nơi phát triển không ngừng tại TP thủ đức của VINGROUP xanh sạch đẹp .\n - Rất monh gặp người thiện chí.\n - Xin liên hệ *** để biết thêm thông tin .\nThanh toán theo options1, 2năm nhận nhà .\n - hoặc số dt *** để thương lượng .','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-06-13 00:00:00',1,1,0,46,2849000000,'Nguyễn Xiển, Phường Long Bình, Thành phố Thủ Đức, Tp Hồ Chí Minh','Hợp đồng mua bán','Tây Bắc','Bàn giao thô','Chung cư',1,0,2,'DMCH0',6,10.8584,106.836),('Giá hot!!! Căn góc 2pn Alnata Plus 85m2, kèm ô xe,nội thất,gốc 4 tỷ 83','Alnata Plus- chỉ một căn giá hot thị trường- bao giá thị trường, hướng mát, giá gốc 4 tỷ 829, giá bán lại cận sàn, giá một không hai tại Celadon City. Alo em Quyên ngay nhé anh chị, view ôm trọn đại lộ, landmark, số lượng hiếm\n\nThông tin căn hộ:\nDiện tích: 85m2\nThiết kế 2PN2WC\nGiá gốc: 4 tỷ 829 full 102%\nHướng: Đông Nam, mát cả ngày\n\nThông tin thanh toán:\nCọc 200tr\nSau 2 tuần sang tên chồng đủ tiền\n\nAlo em Quyên xem nhà trong 1 nốt nhạc\nCam kết hồ sơ nhanh\nCam kết nhà thật, giá thật\nCam kết giao dịch chuẩn, tại CDT Gamuda Land','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-08-28 00:00:00',2,2,0,85,4829000000,'số 88, N1, Phường Sơn Kỳ, Quận Tân Phú, Tp Hồ Chí Minh','Hợp đồng mua bán','Tây Bắc','Hoàn thiện cơ bản','Chung cư',1,0,3,'DMCH0',7,10.8044,106.618),('Giá cực hot! căn 2 view 131m2, 3pn chỉ 7 tỷ 480 full 102%','Diamond Brilliant- phân khu với mật độ cây xanh lớn nhất toàn dự án\nThiết kế 3PN-2WC\nDiện tích 131m2\nLoại căn đặc biệt nhất tại phân khu Diamond Brilliant\nSố lượng có hạn\n\nGiá bán: 7 tỷ 480 full 102%\nAlo em Quyên đi xem nhà nhé anh chị','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-10-28 00:00:00',3,2,0,131,7480000000,'số 88, N1, Phường Sơn Kỳ, Quận Tân Phú, Tp Hồ Chí Minh','Hợp đồng mua bán','Đông','Hoàn thiện cơ bản','Chung cư',1,0,2,'DMCH0',8,10.8044,106.618),('Chung cư miếu nổi ngay khu ăn uống phan xích long ,40m2 giá 2tyx','Bán chung cư miếu nổi ĐƯỜNG VŨ HUY TẤN ,cạnh khu ăn uống PHAN XÍCH LONG ,dt 40m2 bảo vệ 24/24h,có thang máy ,khoá thẻ từ \nGiá 2,1 tỷ \nLh :***','ACCEPTED','2024-04-28 22:28:03','2024-04-28 22:28:03','2024-11-08 00:00:00',2,2,0,40,2100000000,'Vũ Huy Tấn, Phường 3, Quận Bình Thạnh, Tp Hồ Chí Minh','Sổ hồng riêng','','Hoàn thiện cơ bản','Chung cư',1,0,2,'DMCH0',9,10.796,106.692),('Giá hot! View Đông Nam Celadon Brilliant 112m2 giá gốc 5 tỷ 584','Diamond Brilliant - viên kim cương với mật độ cây xanh phủ cực lớn toàn khu Celadon City\n**Thông tin căn hộ:\nDiện tích 112m2 thiết kế thành 3pn\nView hướng Tây Nam\nCửa chính Đông Bắc\nView qua công viên trung tâm dự án, cực t